using Models;
using Common;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Services;

public interface IUserService
{
    /// <summary>
    /// 로그인한 사용자 정보
    /// </summary>
    User UserInfo { get; init; }

    /// <summary>
    /// 사용자 프로필 정보 요청
    /// </summary>
    /// <param name="id"></param>
    /// <returns></returns>
    Task<UserProfile?> GetMyProfileAsync(Guid id);

    /// <summary>
    /// 친구 목록 요청
    /// </summary>
    /// <param name="id"></param>
    /// <returns></returns>
    Task<IList<User>?> GetFriendListAsync(Guid id);

    void KeepAlive();

    bool UserLogout();
}

public class UserService : IUserService
{
    public UserService(ILoginService loginService)
    {
        UserInfo = loginService.UserInfo;
    }

    public User UserInfo { get; init; }

    public async Task<IList<User>?> GetFriendListAsync(Guid id)
    {
        // TODO-Server : id 이용
        // TODO-Server : 서버에 친구 목록 정보 요청

        // 친구 리스트에 로그인된 자신 등록
        List<User> friendList = new List<User>();
        friendList.Add(UserInfo);

        // 친구 리스트 추가 [mock data]
        var tasks = Enumerable.Range(0, 10).Select(p => this.CreateMockDataByUser(p));
        friendList.AddRange(await Task.WhenAll(tasks));

        return friendList;
    }

    public async Task<UserProfile?> GetMyProfileAsync(Guid id)
    {
        // TODO-Server : id 이용
        // TODO-Server : 서버에 프로필 정보 요청

        return await Task.Run(() =>
        {
            try
            {
                UserProfile profile = new UserProfile()
                {
                    UserProfileImgBase64 = "",
                    Status = "Hi there 👋"
                };
                return profile;
            }
            catch (Exception ex)
            {
                Logger.Log.Error(ex);
                return null;
            }
        });
    }

    public void KeepAlive()
    {
        // TODO-Server : 서버와 KeepAlive 처리
    }

    private async Task<User> CreateMockDataByUser(int num)
    {
        return await Task.Run(() =>
        {
            Thread.Sleep(3000);  // 로딩 표시 fake

            UserProfile profile = new UserProfile()
            {
                UserProfileImgBase64 = "",
                Status = $"친구-{num}"
            };

            User user = new User()
            {
                Id = Guid.NewGuid(),
                FriendUserType = Common.Enums.EFriendUserType.Friend,
                Name = $"친구-{num}",
                PhoneNumber = num.ToString(),
                Nationality = "KR",
                Email = $"friend_{num}@wpfkakao.com",
                NickName = $"arooong_친구{num}",
                UserProfile = profile
            };

            return user;
        });
    }

    public bool UserLogout()
    {
        // TODO-Server : 사용자 로그아웃시 서버에 로그아웃 요청을 하여 서버측 세션 정리
        return true;
    }
}
